n class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2019/" target="_blank">2019</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.08.31</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>2019年国际篮联篮球世界杯（英语：2019 FIBA Basketball World Cup）暨第18届国际篮联篮球世界杯（世界男子篮球锦标赛更名为篮球世界杯后的第二届世界杯），将于2019年8月31日至9月15日在中国的北京、广州、南京、上海、武汉、深圳、佛山、东莞等八座城市举行参赛队伍由20</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/101375/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/101174/" data-original="http://pic.iqiyi6123.com/upload/vod/2019-08-30/15671255660.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">2.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">01</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/101174/">最美的安排</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E8%8C%83%E6%98%8E------------/" target="_blank">范明</a>&nbsp;<a href="/s/-%E9%A2%9C%E4%B8%B9%E6%99%A8------------/" target="_blank">颜丹晨</a>&nbsp;<a href="/s/-%E5%BC%A0%E5%A4%A7%E9%9D%99------------/" target="_blank">张大静</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E5%88%98%E5%9B%BD%E6%9D%83--------/" target="_blank">刘国权</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/13/" target="_blank">国产剧</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2019/" target="_blank">2019</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.08.31</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>潘大为（范明饰）的凄子杨冰去世多年杨冰孪生妹妹杨清从国外归来，想要找回当年遗弃的孩子，而这个孩子就是潘大为的女儿潘朵拉。潘大为不许杨清告诉孩子真相，杨清便以二姨的身份跟潘朵拉建立了深厚的感情。杨清想偷偷带潘朵拉出国，被潘朵拉发现真相，与杨清断绝关系。杨清为了得到潘朵拉的原谅，决定跟潘大为结婚，遭到潘</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/101174/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/100731/" data-original="http://cj.subo8988.com:8988/upload/vod/2019-08-27/201908271566836802.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">1.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">更新至02集</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/100731/">遇见幸福</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E8%92%8B%E6%AC%A3------------/" target="_blank">蒋欣</a>&nbsp;<a href="/s/-%E6%9D%8E%E5%85%89%E6%B4%81------------/" target="_blank">李光洁</a>&nbsp;<a href="/s/-%E9%83%AD%E4%BA%AC%E9%A3%9E------------/" target="_blank">郭京飞</a>&nbsp;<a href="/s/-%E5%88%98%E5%AD%9C------------/" target="_blank">刘孜</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-------------/" target="_blank"></a>&nbsp;<a href="/s/-----%E6%A2%A6%E7%BB%A7--------/" target="_blank">梦继</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/13/" target="_blank">国产剧</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2019/" target="_blank">2019</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.08.31</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>出生于1978年的甄开放、萧晴、欧阳严严，小时候由于父亲们的相互交好而成为好朋友，然而时光荏苒，三十多年后的再聚竟如此陌生之后，随着父亲们的到来，三位儿时的伙伴重新有了更多联系。此时，甄开放离婚又失业，成了单身妈妈；萧晴与刚读大学的女儿面临着前所未有的“战争”。人生赢家欧阳严严却突然辞职，给家庭带来</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/100731/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/100730/" data-original="http://cj.subo8988.com:8988/upload/vod/2019-08-27/201908271566836323.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">9.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">更新至02集</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/100730/">陆战之王</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E9%99%88%E6%99%93------------/" target="_blank">陈晓</a>&nbsp;<a href="/s/-%E7%8E%8B%E9%9B%B7------------/" target="_blank">王雷</a>&nbsp;<a href="/s/-%E5%90%B4%E6%A8%BE------------/" target="_blank">吴樾</a>&nbsp;<a href="/s/-%E5%BC%A0%E9%9B%85%E9%92%A6------------/" target="_blank">张雅钦</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E5%BA%B7%E6%B4%AA%E9%9B%B7--------/" target="_blank">康洪雷</a>&nbsp;<a href="/s/-----%E5%BC%A0%E5%AF%92%E5%86%B0--------/" target="_blank">张寒冰</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/13/" target="_blank">国产剧</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2019/" target="_blank">2019</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.08.31</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>&nbsp;该剧讲述了95后新兵张能量和黄晓萌进入部队后遇到老兵班长牛努力和特种兵杨俊宇，新兵和老兵在一次次的观念碰撞中，不断经受磨砺、收获成长，最终成为新时代坦克兵的故事通过记录军改时期九旅从“装甲九旅”变为“合成九旅”的改革历程，从普通军人的赤子之心折射出大国雄起的强军梦，抒写当代青年的爱国情怀</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/100730/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/100709/" data-original="http://cj.subo8988.com:8988/upload/vod/2019-08-26/201908261566828294.png"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">10.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">更新至02集</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/100709/">老酒馆</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E9%99%88%E5%AE%9D%E5%9B%BD------------/" target="_blank">陈宝国</a>&nbsp;<a href="/s/-%E7%A7%A6%E6%B5%B7%E7%92%90------------/" target="_blank">秦海璐</a>&nbsp;<a href="/s/-%E5%86%AF%E9%9B%B7------------/" target="_blank">冯雷</a>&nbsp;<a href="/s/-%E5%88%98%E6%A1%A6------------/" target="_blank">刘桦</a>&nbsp;<a href="/s/-%E7%A8%8B%E7%85%9C------------/" target="_blank">程煜</a>&nbsp;<a href="/s/-%E5%86%AF%E6%81%A9%E9%B9%A4------------/" target="_blank">冯恩鹤</a>&nbsp;<a href="/s/-%E7%8E%8B%E6%99%93%E6%99%A8------------/" target="_blank">王晓晨</a>&nbsp;<a href="/s/-%E5%B7%A9%E6%B1%89%E6%9E%97------------/" target="_blank">巩汉林</a>&nbsp;<a href="/s/-%E6%96%B9%E6%B8%85%E5%B9%B3------------/" target="_blank">方清平</a>&nbsp;<a href="/s/-%E7%89%9B%E7%8A%87------------/" target="_blank">牛犇</a>&nbsp;<a href="/s/-%E7%9F%B3%E5%85%86%E7%90%AA------------/" target="_blank">石兆琪</a>&nbsp;<a href="/s/-%E7%99%BD%E5%BF%97%E8%BF%AA------------/" target="_blank">白志迪</a>&nbsp;<a href="/s/-%E6%9B%B9%E5%8F%AF%E5%87%A1------------/" target="_blank">曹可凡</a>&nbsp;<a href="/s/-%E5%B2%B3%E7%BA%A2------------/" target="_blank">岳红</a>&nbsp;<a href="/s/-%E5%BC%A0%E6%99%9E%E4%B8%B4------------/" target="_blank">张晞临</a>&nbsp;<a href="/s/-%E8%A2%81%E5%A7%97%E5%A7%97------------/" target="_blank">袁姗姗</a>&nbsp;<a href="/s/-%E5%B1%A0%E6%B4%AA%E5%88%9A------------/" target="_blank">屠洪刚</a>&nbsp;<a href="/s/-%E9%99%88%E6%9C%88%E6%9C%AB------------/" target="_blank">陈月末</a>&nbsp;<a href="/s/-%E5%A7%AC%E4%BB%96------------/" target="_blank">姬他</a>&nbsp;<a href="/s/-%E8%B0%AD%E5%B3%B0------------/" target="_blank">谭峰</a>&nbsp;<a href="/s/-%E5%88%9A%E6%AF%85------------/" target="_blank">刚毅</a>&nbsp;<a href="/s/-%E5%AF%92%E9%9D%92------------/" target="_blank">寒青</a>&nbsp;<a href="/s/-%E7%8E%8B%E6%99%93%E9%BE%99------------/" target="_blank">王晓龙</a>&nbsp;<a href="/s/-%E8%90%A7%E6%9D%BE%E5%8E%9F------------/" target="_blank">萧松原</a>&nbsp;<a href="/s/-%E7%94%B0%E5%B0%8F%E6%B4%81------------/" target="_blank">田小洁</a>&nbsp;<a href="/s/-%E5%BC%A0%E5%8F%AF%E7%9B%88------------/" target="_blank">张可盈</a>&nbsp;<a href="/s/-%E6%9B%B9%E6%A2%A6%E6%A0%BC------------/" target="_blank">曹梦格</a>&nbsp;<a href="/s/-%E9%A9%AC%E7%A8%8B%E7%A8%8B------------/" target="_blank">马程程</a>&nbsp;<a href="/s/-%E5%86%AF%E7%93%85------------/" target="_blank">冯瓅</a>&nbsp;<a href="/s/-%E6%9B%B2%E6%A0%85%E6%A0%85------------/" target="_blank">曲栅栅</a>&nbsp;<a href="/s/-%E8%94%A1%E8%8D%A3------------/" target="_blank">蔡荣</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E5%88%98%E6%B1%9F--------/" target="_blank">刘江</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/13/" target="_blank">国产剧</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2019/" target="_blank">2019</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.08.31</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>1928年到1949年的东北，“闯关东”来东北的小人物陈怀海，在东北深山老林里挖参讨生活，却意外地遭受了一双儿女失散，媳妇被骗走的磨难，只好来到日本殖民统治下的大连开酒馆谋生计老酒馆由此成了八方信息、各色人等汇聚的舞台。仁义坚韧，嫉恶如仇的陈怀海利用这个舞台，保护了杀日本宪兵的“老北风”，劝说了东北</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/100709/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/94260/" data-original="http://cj.subo8988.com:8988/upload/vod/2019-07-21/201907211563642298.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">4.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">更新至00期</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/94260/">中餐厅第三季</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E9%BB%84%E6%99%93%E6%98%8E------------/" target="_blank">黄晓明</a>&nbsp;<a href="/s/-%E6%9D%A8%E7%B4%AB------------/" target="_blank">杨紫</a>&nbsp;<a href="/s/-%E7%8E%8B%E4%BF%8A%E5%87%AF------------/" target="_blank">王俊凯</a>&nbsp;<a href="/s/-%E7%A7%A6%E6%B5%B7%E7%92%90------------/" target="_blank">秦海璐</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span>未知</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/3/" target="_blank">综艺</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2019/" target="_blank">2019</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span clas