声入人心》是湖南卫视重磅打造的音乐类节目，36位演唱成员在“首席”和“替补”两个角色间轮换，节目由舞台公演和真人秀两部分组成，观众既可欣赏到顶尖水准的美声歌剧表演...</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/70355/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/48355/" data-original="https://img.tupian-zuida.com/pic/upload/vod/2018-03-20/201803201521518593.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">5.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD1280高清国语中字版</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/48355/">跃影江湖之唐家诀</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E6%9D%8E%E6%B3%BD%E9%B9%8F------------/" target="_blank">李泽鹏</a>&nbsp;<a href="/s/-%E9%BB%84%E8%AF%AD%E6%A3%AE------------/" target="_blank">黄语森</a>&nbsp;<a href="/s/-%E9%87%91%E6%B3%B0%E4%BC%B6------------/" target="_blank">金泰伶</a>&nbsp;<a href="/s/-%E5%BA%84%E7%80%9A------------/" target="_blank">庄瀚</a>&nbsp;<a href="/s/-%E8%B4%BE%E6%99%93%E9%BE%99------------/" target="_blank">贾晓龙</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E5%90%B4%E4%BF%8A%E8%B4%A4--------/" target="_blank">吴俊贤</a>&nbsp;<a href="/s/-----%E8%B7%83%E5%BD%B1%E6%B1%9F%E6%B9%96%E4%B9%8B%E9%BE%99%E9%97%A8%E4%B9%8B%E7%BA%A6--------/" target="_blank">跃影江湖之龙门之约</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/11/" target="_blank">剧情片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2018/" target="_blank">2018</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.08.31</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>《跃影江湖》改编自马晓样（原名马璐璐）、安重伊（原名安蔚）所作的系列小说，由金梦、孟宪瑞操刀编剧，吴俊贤执导，李泽鹏、黄语森、金泰伶、庄瀚、贾晓龙参演的系列网络电影讲述的是明朝中期江湖中各方势力混杂，百年唐门遭寻变故，掌门意外惨死，宝物暴雨梨花针失窃，江湖风云变幻莫测，手足兄弟难逃反目命运，结局虐心</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/48355/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/42092/" data-original="http://cj.subo8988.com:8988/upload/vod/2018-11-24/201811241543057510.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">5.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/42092/">梦回追凶</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E8%A9%B9%E6%99%BA%E5%BA%B7------------/" target="_blank">詹智康</a>&nbsp;<a href="/s/-%E5%B0%A4%E4%BA%A6%E6%B3%BD------------/" target="_blank">尤亦泽</a>&nbsp;<a href="/s/-%E9%A9%AC%E5%A6%AE------------/" target="_blank">马妮</a>&nbsp;<a href="/s/-%E8%8B%97%E9%9D%92------------/" target="_blank">苗青</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-t